    const {articles} = props;
    let aa = null; 
  let ee =  articles && articles.length > 0 ? articles.map((item,key)=> {
        const moonLanding = new Date(item.created_date);
        const months = ["January","February","March","April","May","June","July","August","September","October","November","December"];
        const result = months[moonLanding.getMonth()] + '-'+ moonLanding.getFullYear() + ' ' +'('+key+')';
        aa[item] = item;
        return result
    }) : []
    console.log(aa,'=============>a')
    return(
        <div className="box"> 
            {
                ee && ee.length > 0 ? ee.map((item,key)=> {
                     console.log(item,'=====>?')
                    return(
                        <div  key={key} className="row">
                            <p>{item}</p>
                        </div>
                    )
                }) : <p>not find products</p>
            }
        </div>
    )
}

export default ArticelV
